//Внимание! Этот код не проходит через babel! Нужно писать в старом стиле через "var" и "function" вместо "let" и "() => {}" и т. д.
//Должен быть максимально совместимый код

Broadcast.on("Setup Hook", function() {

	MRAID.log('Release Setup Hook', MRAID.android);

	//2020.04.17 iron-source stateChange и viewableChange работают корректно (а браузерный visibilitychange - нет)
	dapi.addEventListener("viewableChange", function(e) {

		MRAID.log('DAPI viewableChange', e.isViewable);

		MRAID.setViewable(e.isViewable);

	});

	dapi.addEventListener("adResized", function() {

		MRAID.log('DAPI adResized');

		Broadcast.call("Mraid Resized");

	});

	dapi.addEventListener('audioVolumeChange', function() {

		MRAID.log('DAPI audioVolumeChange', dapi.getAudioVolume());

		if (App.Engine === 'Pixi' && PIXI.sound) PIXI.sound.volumeAll = dapi.getAudioVolume() / 100;
		else if (App.Engine === 'Three') App.audioListener.setMasterVolume(dapi.getAudioVolume() / 100);

	});

}, "release");

Broadcast.on("Ready Detection Hook", function(next) {

	MRAID.log('Release Ready Detection Hook');

	if (dapi.isReady()) {

		MRAID.log('Iron Source DAPI ready!');

		MRAID._mraidReady = true;

		MRAID._checkReady(next);

	} else {

		MRAID.log('Iron Source DAPI not ready...');

		dapi.addEventListener("ready", function() {

			MRAID.log('Iron Source DAPI ready!');

			dapi.removeEventListener("ready", arguments.callee);

			MRAID._mraidReady = true;

			MRAID._checkReady(next);

		});

	}

}, "release");

Broadcast.on("MRAID Ready", function() {

	MRAID.log('Release MRAID Ready Hook');

	MRAID.log('dapi.isViewable()', dapi.isViewable());

	MRAID.setViewable(dapi.isViewable());

	MRAID.log('typeof dapi.getAudioVolume', typeof dapi.getAudioVolume);

	if (dapi.getAudioVolume) {

		if (App.Engine === 'Pixi' && PIXI.sound) PIXI.sound.volumeAll = dapi.getAudioVolume() / 100;
		else if (App.Engine === 'Three') App.audioListener.setMasterVolume(dapi.getAudioVolume() / 100);

		MRAID.log('DAPI getAudioVolume() start', dapi.getAudioVolume());

	}

}, "release");

Broadcast.on("Creative Showed", function() {

	MRAID.log('Release Creative Showed Hook');

	MRAID.log('typeof dapi.getAudioVolume', typeof dapi.getAudioVolume);

	if (dapi.getAudioVolume) {

		if (App.Engine === 'Pixi' && PIXI.sound) PIXI.sound.volumeAll = dapi.getAudioVolume() / 100;
		else if (App.Engine === 'Three') App.audioListener.setMasterVolume(dapi.getAudioVolume() / 100);

		MRAID.log('DAPI getAudioVolume() showed', dapi.getAudioVolume());

	}

}, "release");

MRAID.releaseOpen = function() {

	//2020.05.03 ironSource told to remove this code and use simple dapi.openStoreUrl();
	//if ((Settings["target-url"].indexOf("play.google.com") > -1 || Settings["target-url"].indexOf("apple.com") > -1) && dapi.openStoreUrl) dapi.openStoreUrl(Settings["target-url"]);
	//else dapi.open(Settings["target-url"]);

	dapi.openStoreUrl();

};

MRAID.releaseGetSize = function() {

	if (Settings["viewport-size"] === "mraid-screen-size" && dapi.getScreenSize) {

		return dapi.getScreenSize();

	} else if (Settings["viewport-size"] === "screen-size" && window.screen) {

		return window.screen;

	}

};

Loader.start();</script>
